SIS (2008)

De Special Investigation Squad jaagt op criminelen in de straten van LA. 
S.I.S draait om een agent die het zwaar heeft gehad en wordt aangesteld om met 
de Special Investigative Section te werken; een elite undercover tak van de L.A.P.D., 
die de meest gevaarlijke criminelen opspoort en ze op heterdaad probeert te betrappen. 


